import React from "react";
import { Tag, TagLabel, TagCloseButton } from "@chakra-ui/react";
const SingleSearchResult = (props) => {
  return (
    <div className="px-32  w-full border-0 border-black pl-0 ml-3 mr-3 flex flex-row justify-around items-baseline">
      <h1 className="font-thin w-52">{props.firstName}</h1>
      <h1 className="font-thin w-52">{props.lastName}</h1>
      <h1 className="font-thin w-64">{props.email}</h1>
      <h1 className="font-thin w-52">{
      props.course.map((item)=> <Tag
      size="lg"
      key="lg"
      borderRadius="full"
      variant="solid"
      colorScheme="green"
      margin="1"
    >
      <TagLabel>{`${item}`}</TagLabel>
      <TagCloseButton onClick={() => removeCourse(item)} />
    </Tag>)
      }</h1>
    </div>
  );
};

export default SingleSearchResult;
